import "./App.css";
import Navbar from "./components/Navbar";
import Row from "./components/Row";
import Table from "./components/Table";
import Master from "./components/Master";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  const rows = [];
  rows.push(
    <tr>
      <th>Name</th>
      <td>Email</td>
      <td>Phone Number</td>
      <td>House/Yard</td>
      <td>Suite</td>
      <td>Class Year</td>
      <td>Home City</td>
      <td>Home State</td>
      <td>Contact Status</td>
      <td>PTE Status</td>
      <td>Registration Status</td>
      <td>Stage of Voting Process</td>
      <td>Where Registered</td>
    </tr>
  );

  return (
    <>
      <Router>
        <Navbar />
        <Routes>
          {/* <Route path="/sign-up" component={SignUp} /> */}
          <Route path="/" exact />
        </Routes>
      </Router>
      <Master table={rows} />
    </>
  );
}

export default App;
